import * as React from 'react';
import Box from '@mui/material/Box';
import SpeedDial from '@mui/material/SpeedDial';
import SpeedDialIcon from '@mui/material/SpeedDialIcon';
import SpeedDialAction from '@mui/material/SpeedDialAction';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import InstagramIcon from '@mui/icons-material/Instagram';
import EmailIcon from '@mui/icons-material/Email';
import { useNavigate  } from 'react-router-dom';
import Mascot from '../../assets/BIA_MASCOT.png'
const actions = [
  { icon: <LinkedInIcon />, name: 'LinkedIn',  link:'https://www.linkedin.com/company/smubia/' },
  { icon: <InstagramIcon />, name: 'Instagram', link: 'https://www.instagram.com/smu.bia/'},
  { icon: <EmailIcon />, name: 'Email', link: '%20bia@sa.smu.edu.sg' },
];

<SvgIcon>
  <svg
    xmlns={mascot}
    fill="none"
    viewBox="0 0 24 24"
    strokeWidth={1.5}
    stroke="currentColor"
  >
    <path
      strokeLinecap="round"
      strokeLinejoin="round"
      d="M4.5 12a7.5 7.5 0 0015 0m-15 0a7.5 7.5 0 1115 0m-15 0H3m16.5 0H21m-1.5 0H12m-8.457 3.077l1.41-.513m14.095-5.13l1.41-.513M5.106 17.785l1.15-.964m11.49-9.642l1.149-.964M7.501 19.795l.75-1.3m7.5-12.99l.75-1.3m-6.063 16.658l.26-1.477m2.605-14.772l.26-1.477m0 17.726l-.26-1.477M10.698 4.614l-.26-1.477M16.5 19.794l-.75-1.299M7.5 4.205L12 12m6.894 5.785l-1.149-.964M6.256 7.178l-1.15-.964m15.352 8.864l-1.41-.513M4.954 9.435l-1.41-.514M12.002 12l-3.75 6.495"
    />
  </svg>
</SvgIcon>

export default function SideBar() {
    const history = useNavigate();
    const handleActionClick = (link) => {
      if (link.startsWith('http') || link.startsWith('mailto')) {
        window.open(link, '_blank');
      } else {
        history.push(link);
      }}
  return (
    <Box sx={{ height: 320, transform: 'translateZ(0px)', flexGrow: 1, position:'fixed', width:'9%', right:'5%',bottom:'2%'}}>
        <SpeedDial 
        ariaLabel="SpeedDial basic example"
        sx={{ position: 'absolute', bottom: 16, right: 16 }}
        icon={Mascot}
      >
        {actions.map((action) => (
          <SpeedDialAction
            key={action.name}
            icon={action.icon}
            tooltipTitle={action.name}
            onClick={() => handleActionClick(action.link)}
          />

        ))}
      </SpeedDial>
    </Box>
  );
}
